import React from 'react';
import {
    Container,
    Row,
    Col,
    Card,
    CardHeader,
    ListGroup,
    ListGroupItem,
    Form,
    Alert
} from "shards-react";

import actions from "../components/components-tb/actions";
import dataReducer from "../components/components-tb/dataReducer";
import DataTable from "../components/components-tb/DataTable";
// import RadioButtons from "../components/components-overview/RadioButtons";
// import ToggleButtons from "../components/components-overview/ToggleButtons";
// import SmallButtons from "../components/components-overview/SmallButtons";

const ComponentsTb = () => (
    <Container fluid className="main-content-container px-4">
        <Row>
            <Col lg="8" className="mb-4">
                {/* <actions /> */}
                <dataReducer />
                <DataTable />
            </Col>
        </Row>
    </Container>
);

export default ComponentsTb;
